import { RiDeleteBack2Line, RiRefreshLine } from 'react-icons/ri';
import Button from '../UI/Button';

function TodosActions() {
  return (
    <>
      <Button>Reset</Button>
      <Button>Delete Completed</Button>
    </>
  );
}

export default TodosActions;
